import createReactComponent from "../createReactComponent";
import defaultAttributes from "../defaultAttributes";
var Lock = createReactComponent("Lock", ["svg", defaultAttributes, [["rect", {
  x: "3",
  y: "11",
  width: "18",
  height: "11",
  rx: "2",
  ry: "2",
  key: "1jfkdd"
}], ["path", {
  d: "M7 11V7a5 5 0 0110 0v4",
  key: "3zkwqh"
}]]]);
export default Lock;
